option.value:
// update tb_locker board_id int to String type
        database.execSQL("ALTER TABLE tb_locker RENAME COLUMN board_id TO board_id_old")
        database.execSQL("ALTER TABLE tb_locker ADD COLUMN board_id TEXT NOT NULL DEFAULT ''")
        database.execSQL("UPDATE tb_locker SET board_id = board_id_old")
        // 删除 board_id_old
        database.execSQL("ALTER TABLE tb_locker DROP COLUMN board_id_old")

@echo off
setlocal enabledelayedexpansion
 :: 设置代码页为 UTF-8
chcp 65001 > nul

echo -----------by Mocaris---------------------

:: 执行 adb devices 命令并获取设备列表
for /f "tokens=1" %%a in ('adb devices ^| findstr /v "List"') do (
    set "devices=!devices! %%a"
)

:: 检查是否有设备连接
if "%devices%" == "" (
    echo 没有检测到任何设备，请确保设备已正确连接并开启调试模式。
    exit /b 1
)

:: 输出设备列表供用户选择
echo 请选择一个设备：
set count=0
for %%d in (%devices%) do (
    set /a count+=1
    echo !count!: %%d
    set "device!count!=%%d"
)

:: 获取用户输入
set /p choice=请输入设备编号:

:: 验证用户输入
if %choice% gtr %count% (
    echo 无效的选择，请重新选择。
    exit /b 1
)

:: 获取用户选择的设备
set device=
for /l %%i in (1,1,%count%) do (
    if %choice%==%%i (
        set "device=!device%%i!"
    )
)

if "%device%" == "" (
    echo 无效的选择，请重新选择。
    exit /b 1
)

echo 您选择了设备: %device%

:: 设置 APK 文件路径
set apkPath=%scriptDir%Launcher3.apk

:: 执行 adb install 命令并等待
echo 正在安装应用...
adb -s %device% install -rn "%apkPath%"

:: 检查安装结果
if %errorlevel% neq 0 (
  echo 应用安装失败。按任意键退出...
     pause > nul
     exit /b 0
)
:: 执行 adb am start -n 命令启动应用
echo 正在启动应用...
adb -s %device% shell am start -n com.android.launcher3/.Launcher
if %errorlevel% equ 0 (
    echo 应用启动成功。
)

echo 开始卸载小铁应用...
adb -s %device% shell pm uninstall com.orange.service
if %errorlevel% equ 0 (
    echo 小铁服务卸载成功。
)

adb -s %device% shell pm uninstall com.orange.cabinet
if %errorlevel% equ 0 (
    echo 小铁应用卸载成功。
)

echo 按任意键退出...
pause > nul
exit /b 0
